import React, { Component } from 'react';
import Form from 'Form';

class Control extends Component {    
  render() {
    return (             
        <div className="row">                    
            <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12" style={{margin: "20px 0"}}>                        
                <div className="col-xs-12 col-sm-12 col-md-3 col-lg-3" style={{padding: "0"}}>
                    <button type="button" className="btn btn-large btn-block btn-success">Add Task</button>
                </div>

                {/* CONTROL : START */} 
                <Form />
                {/* CONTROL : END */}            
            </div>
            <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
                <input type="text" className="form-control" placeholder="Filter"></input>
                <hr />
            </div>  
        </div>   
    );
  }
}

export default Control;
